import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './Header.scss';

class Header extends Component {
  render() {
    return (
      <div id="header" className="header">
        <h1 className="test-scss">Helol</h1>
      </div>
    );
  }
}

export default Header;
